<!-- 图片编辑 -->
<template>
   <map-drag :fixed="false" class="panel-position" v-show="isShow">
      <header class="title">
        图片编辑
        <span class="close" @click="hide()">x</span>
      </header>
      <div class="panel-content">
        <el-form>
          <el-form-item label="高度：">
            <el-input v-model="input1" class="el-input--suffix"></el-input>
          </el-form-item>
          <el-form-item label="宽度：">
            <el-input v-model="input2" class="el-input--suffix"></el-input>
          </el-form-item>
          <el-form-item label="图片：">
            <el-upload
              class="upload-demo"
              action=""
              :thumbnail-mode="false"
              :on-change="handleChange"
              :auto-upload="false">
              <el-button slot="trigger" size="small" type="primary">选择图片</el-button>
            </el-upload>
          </el-form-item>
          <el-form-item label="预览：">
            <img :src="fileStr" width="280" height="180"/>
          </el-form-item>
          <el-form-item label="" class="btns">
            <el-button type="success" @click="ok">确定</el-button>
            <el-button type="info" @click="hide">取消</el-button>
          </el-form-item>
        </el-form>
      </div>
    </map-drag>
</template>

<script>
import MapDrag from '@/components/map/map-drag.vue'
import Vue from 'vue'
import {
  Upload
} from 'element-ui'
Vue.use(Upload)
export default {
  components: {MapDrag},
  data () {
    return {
      isShow: false,
      input1: '320',
      input2: '180',
      fileStr: 'data:image/png;base64,'
    }
  },
  methods: {
    show () {
      this.isShow = true
    },
    hide () {
      this.isShow = false
    },
    handleChange (file, fileList) {
      file = file.raw
      let reader = new FileReader()
      let self = this
      reader.onloadend = function () {
        self.fileStr = this.result
      }
      reader.readAsDataURL(file)
    },
    ok () {
      this.$emit('input-result', this.fileStr, {
        w: this.input1,
        h: this.input2
      })
      this.hide()
    }
  }
}

</script>
